function isTokenInGroup(uint tokId, uint gid) private view returns(bool) {
  for ( uint i = 0; i < daoGroups[gid].tokenIds.length; i++){
    if ( daoGroups[gid].tokenIds[i] == tokId ){
      return true;
    }
  }
  return false;
}

}
